import React from 'react'

const Main = ({users}) => {
  return (
    <section className='main'>
      {users.map(user => (
      <label key={user.id}>
        <p>username:</p>
        <p>{user.name}</p>
      </label>
      ))}
    </section>
  )
}

export default Main
